import React, { Component } from 'react'
import { Text, View,Image,ImageBackground } from 'react-native'

export default class MyImage extends Component {
	render() {
		return (
			<View>
				{/* 1.引入本地图片 */}
				<Image 
					style={{width:200,height:200,backgroundColor:'pink'}}
					resizeMode="stretch"
					source={require('../../assets/imgs/car.jpg')}
				/>
				{/* 2.引入网络图片 */}
				{/* 如果使用uri的形式指定图片，必须给图片指定宽高，否则不显示 */}
				<Image 
					style={{width:200,height:200,backgroundColor:'pink'}}
					resizeMode="contain"
					source={{uri:'https://www.baidu.com/img/pc_cc75653cd975aea6d4ba1f59b3697455.png'}}
				/>
				{/* 3.引入base64图片 */}
				<Image 
					style={{width:200,height:200,backgroundColor:'pink'}}
					resizeMode="contain"
					source={{uri:'data:image/png;base64,'}}
				/>
				{/* 4.图片背景 */}
				<ImageBackground
					style={{width:200,height:200,backgroundColor:'pink'}}
					resizeMode="stretch"
					source={require('../../assets/imgs/car.jpg')}
				>
					<Text style={{fontWeight:'bold',color:'yellow'}}>跑车</Text>
				</ImageBackground>
			</View>
		)
	}
}
